class UsersTest(APITestCase):

    def login_user(self, role=None):
        if role == 'admin':
            response = self.client.post(path='/api/auth/login/',
                                        data={'email': 'admin@admin.com', 'password': 'swipe5231'},
                                        format='json')
        elif role == 'builder':
            response = self.client.post(path='/api/auth/login/',
                                        data={'email': 'builder@builder.com', 'password': 'swipe5231'},
                                        format='json')
        else:
            response = self.client.post(path='/api/auth/login/',
                                        data={'email': 'user@user.com', 'password': 'swipe5231'},
                                        format='json')
        return response.data

    def setUp(self) -> None:
        init_scripts()

    def test_login(self):
        response = self.client.post('/api/auth/login/', {'email': 'admin@admin.com', 'password': 'swipe5231'}, format='json')
        assert response.status_code == status.HTTP_200_OK


    def test_logout(self):
        self.client.credentials(HTTP_AUTHORIZATION=f'JWT {self.login_user().get("access_token")}')
        response = self.client.post('/api/auth/logout/')
        assert response.status_code == status.HTTP_200_OK


    def test_change_password(self):
        self.client.credentials(HTTP_AUTHORIZATION=f'JWT {self.login_user("admin").get("access_token")}')
        response = self.client.post('/api/auth/password/change/', data={
            'new_password1': 'swipe5231',
            'new_password2': 'swipe5231'
        })
        assert response.status_code == status.HTTP_200_OK

    def test_blocking_and_unblocking_user(self):
        user_to_block = User.objects.get(role__role='user')
        self.client.credentials(HTTP_AUTHORIZATION=f'JWT {self.login_user("admin").get("access_token")}')
        response = self.client.post(f'/api/v1/user/{user_to_block.id}/block/')
        assert response.status_code == status.HTTP_200_OK

        response = self.client.post(f'/api/v1/user/{user_to_block.id}/unblock/')
        assert response.status_code == status.HTTP_200_OK

    def test_updating_self_account(self):
        self.client.credentials(HTTP_AUTHORIZATION=f'JWT {self.login_user("admin").get("access_token")}')

        response = self.client.patch(path='/api/v1/user/profile/update/',
                                data={
                                    'name': 'Testr',
                                    'surname': 'Tessa',
                                    'turn_calls_to_agent': True
                                })
        print(response)
        assert response.status_code == status.HTTP_200_OK

    def test_creation_and_deletion_user(self):
        role = Role.objects.get(role='user')
        self.client.credentials(HTTP_AUTHORIZATION=f'JWT {self.login_user("admin").get("access_token")}')

        response = self.client.post(path='/api/v1/user/', data={
            "avatar": image,
            "password": "swipe5231",
            "username": "user2@user.com",
            "first_name": "user",
            "last_name": "user",
            "email": "user2@user.com",
            "phone": 2147483647,
            "black_list": True,
            "turn_to_agent": True,
            "role": role.id,
            "agent_first_name": "string",
            "agent_last_name": "string",
            "agent_phone": 2147483647,
            "agent_email": "user@example.com",
        }, format='json')
        user_id = response.data.get('id')

        assert response.status_code == status.HTTP_201_CREATED

        response = self.client.delete(path=f'/api/v1/user/{user_id}/')

        assert response.status_code == status.HTTP_204_NO_CONTENT

